import React from 'react';
import { motion } from 'framer-motion';

const Stats = ({ selectedYear = '2023', stats }) => {
  return (
    <motion.article
      initial="hidden"
      animate="visible"
      exit={{ opacity: 0, transition: { duration: 1 } }}
      variants={{ visible: { transition: { staggerChildren: 0.3 } } }}
    >
      <motion.h1
        variants={{
          hidden: { opacity: 0, y: -20 },
          visible: { opacity: 1, y: 0 }, // Define the visible variant
        }}
        style={{
          "--base-width": "24vw",
          top: "-18vw",
          letterSpacing: "-1.4vw",
          x: "-50%",
        }}
      >
        Galleries
      </motion.h1>
    </motion.article>
  );
};

export default Stats;
